import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/Header/Header'
import Footer from './components/Footer/Footer'
import ProductList from './components/ProductList/ProductList'

function App() {
  return (
    <React.Fragment>
      <Header />
      <ProductList/>
      <Footer/>
    </React.Fragment>
  );
}

export default App;
